let debounceTimeout;
let lastQuery = '';

function filterGames() {
    const input = document.getElementById('searchInput').value.toLowerCase();

    // Skip filtering if the query hasn't changed
    if (input === lastQuery) return;

    lastQuery = input;
    
    const gameLinks = document.querySelectorAll('#gamesList a');
    
    // Use requestAnimationFrame to batch DOM updates
    requestAnimationFrame(() => {
        // Start by hiding all game links at once
        const linksToShow = [];
        const linksToHide = [];
        
        // Gather the links that need to be shown or hidden
        gameLinks.forEach(link => {
            const gameName = link.textContent.toLowerCase();
            if (gameName.includes(input)) {
                linksToShow.push(link);
            } else {
                linksToHide.push(link);
            }
        });

        // Now, hide all non-matching links
        linksToHide.forEach(link => {
            link.style.display = 'none';
        });

        // And show the matching ones
        linksToShow.forEach(link => {
            link.style.display = 'block';
        });
    });
}

document.getElementById('searchInput').addEventListener('keydown', function(event) {
    if (event.key === 'Enter') {
        // Debounce the filtering
        clearTimeout(debounceTimeout);
        debounceTimeout = setTimeout(filterGames, 300);
    }
});
